angular.module("meditask").factory('responseObserver', ['$q', '$window', '$rootScope', function responseObserver($q, $window, $rootScope) {

    return {
        'responseError': function(errorResponse) {
            switch (errorResponse.status) {
                case 401:
                    $rootScope.authenticated = undefined;
                    $rootScope.user = undefined;
                    break;
                case 403:
                    $rootScope.accessDenied();
                    break;
            }
            return $q.reject(errorResponse);
        }
    };

}]);
