function MonthsCtrl($rootScope, $scope, $filter, eventosAPI){

    $scope.events = [];

    $scope.year = moment().format('YYYY');

    $rootScope.totaisAtualizados = false;

    var generateYears = function(year){
      var years = [];
      for(cont = -2; cont <= 2; cont++){
        years.push((parseInt(year) + cont) + "");
      }
      return years;
    }
    $scope.years = generateYears($scope.year);

    $scope.filter = {
      ano: "2017",
      tipo: "null"
    }

    $rootScope.carregarEventosMes = function(year){

        if(!$rootScope.totaisAtualizados || (year && year != $scope.filter.ano)){
          $scope.carregandoEventos = true;

          if(year){
            $scope.filter.ano = year;
          }

          var params = {
            ano:$scope.filter.ano
          }

          eventosAPI.select_totais_ano($rootScope.user.googleToken, params)
           .done(function(data){
                $scope.$apply(function(){
                  $scope.carregandoEventos = false;
                  $scope.totaisAtualizados = true;

                  $scope.meses = [
                    {desc:"JANEIRO", ano:year, val:"01", valor: "0.00"},
                    {desc:"FEVEREIRO", ano:year, val:"01", valor: "0.00"},
                    {desc:"MARÇO", ano:year, val:"01", valor: "0.00"},
                    {desc:"ABRIL", ano:year, val:"01", valor: "0.00"},
                    {desc:"MAIO", ano:year, val:"01", valor: "0.00"},
                    {desc:"JUNHO", ano:year, val:"01", valor: "0.00"},
                    {desc:"JULHO", ano:year, val:"01", valor: "0.00"},
                    {desc:"AGOSTO", ano:year, val:"01", valor: "0.00"},
                    {desc:"SETEMBRO", ano:year, val:"01", valor: "0.00"},
                    {desc:"OUTUBRO", ano:year, val:"01", valor: "0.00"},
                    {desc:"NOVEMBRO", ano:year, val:"01", valor: "0.00"},
                    {desc:"DEZEMBRO", ano:year, val:"01", valor: "0.00"}
                  ];

                  data.forEach(function(totalMes){
                     $scope.meses[totalMes.mes-1].valor = totalMes.total;
                  });

                });
           }).fail(function(data){
              $scope.carregandoEventos = false;
              $rootScope.falha(data);
           });
        }
    }

}

