function SaveEventoCtrl($filter, $mdDialog,$rootScope,$scope,$http,$location,$routeParams, eventosAPI, $filter, dayClicked, localAPI, planoAPI, procedimentoAPI, atividadeAPI, medico){

    $scope.cancelar = $mdDialog.cancel;
    $scope.atividades_planos = [];

    $scope.hospitais = [];
    $scope.atividades = [];

    $scope.subQtdAtvPlano = function(atividade){
      atividade.quantidade--;
    }

    $scope.addQtdAtvPlano = function(atividade){
      atividade.quantidade++;
    }

    $scope.selectHospital = function(hospital){
        $scope.selectedLocal = hospital;
    }

    $scope.removeHospital = function(){
        $scope.selectedLocal = undefined;
    }

    $scope.selectAtividade = function(atividade){
        $scope.atividade = atividade;
    }

    $scope.removeAtividade = function(){
        $scope.atividade = undefined;
    }

    $scope.novoPlano = {
    }

    $scope.evento = {
        dataToolbar : dayClicked.format("MMM/DD"),
        data : dayClicked.format('YYYY-MM-DD'),
        dataFim : dayClicked.format('YYYY-MM-DD'),
        timeInicio: new Date(),
        timeFim: new Date(),
        descricao: "",
        preco_por_evento: 'R$ 0.00',
        diaSeguinte: 0
    };

    var getEvento = function(pk){
        eventosAPI.get(pk)
        .done(function(data){
            $rootScope.isViewLoading = false;
            $scope.evento = data;
        }).fail(function(data){
            $rootScope.isViewLoading = false;
        });
    };

    if($routeParams['pk']){
        getEvento($routeParams['pk']);
    }else{
        $rootScope.isViewLoading = false;
    }

    $scope.salvarPlano = function(plano, $event){

      if(plano.nome){
            $scope.evento.carregandoPlanos = true;
            plano.cor = "#333333";
            planoAPI.insert($rootScope.user.googleToken, plano)
            .done(function(data){
                $scope.evento.carregandoPlanos = false;
                $rootScope.aviso({titulo:'Plano criado com sucesso', mensagem: 'O formulário deverá surgir na listagem de planos!'});
                $scope.$apply(function(){
                  $scope.atividades_planos.push(planosFromDataArray(data)[0]);
                  plano.nome = "";
                  plano.cor = "";
                });
            }).fail(function(data){
                $scope.evento.carregandoPlanos = false;
                $rootScope.falha(data);
            });
      }else{
        $rootScope.aviso({titulo:"Aviso!", mensagem: "Inclua um nome e uma cor para o novo plano!"});
      }

    }

    $scope.salvarEvento = function(evento, atividades_planos){

        evento.local__pk = $scope.selectedLocal.pk;
        evento.atividade__pk = $scope.atividade.pk;
        evento.preco_por_evento = parseFloat(evento.preco_por_evento.replace("R$ ","").replace(",",""));
        evento.atividades_planos = JSON.stringify(atividades_planos);
        evento.dataFim = angular.copy(dayClicked).add(evento.diaSeguinte, 'day').format("YYYY-MM-DD");

        if(evento.timeInicio > evento.timeFim){
          $rootScope.falha({mensagem: "A hora de inicio não pode ser maior que a de fim!"});
          return;
        }

        evento.horaInicio =  $filter('date')(evento.timeInicio , 'HH:mm');
        evento.horaFim =  $filter('date')(evento.timeFim , 'HH:mm');

        $scope.isProcessLoading = true;
        if(evento.pk){
            eventosAPI.update(evento.pk, evento)
            .done(function(data){
                $scope.isProcessLoading = false;
                $mdDialog.hide(data);
            }).fail(function(data){
                $scope.isViewLoading = false;
                $rootScope.falha(data);
            });
        }else{
            eventosAPI.insert($rootScope.user.googleToken, evento)
            .done(function(data){
                $scope.$apply(function(){
                  $scope.isProcessLoading = false;
                  $mdDialog.hide(data);
                });
            }).fail(function(data){
                $scope.isProcessLoading = false;
                $rootScope.falha(data);
            });
        }
    };


    $scope.planos = [];

    var planoFromData = function(data){
      return {
        pk: data.pk,
        nome : data.fields.nome,
        color  : data.fields.cor
      };
    }

    $scope.carregarAtividades = function(){
        if(!$scope.atividades.length){
          $scope.evento.carregandoAtividades = true;
          atividadeAPI.select_all_by_medico($rootScope.user.googleToken)
          .done(function(data){
              $scope.$apply(function () {
                $scope.evento.carregandoAtividades = false;
                $scope.atividades = [];
                data.forEach(function(atividade){
                    $scope.atividades.push({
                        pk: atividade.pk,
                        nome: atividade.fields.nome,
                        descricao: atividade.fields.descricao,
                        plano_paga: atividade.fields.plano_paga,
                        is_procedimento: atividade.fields.is_procedimento,
                        icone: atividade.fields.icone
                    });
                });
              });
          }).fail(function(data){
              $scope.evento.carregandoAtividades = false;
              $rootScope.falha(data);
          });
        }
    }

    var planosFromDataArray = function(data){
        return data.map(function(plano){
            return {
                      plano_id: plano.pk,
                      plano_nome: plano.fields.nome,
                      quantidade : 0,
                      preco: "0.00",
                      color: plano.fields.cor,
                      text_color: $rootScope.getContrastedColor(plano.fields.cor)
                  }
        });
    }

    var procedimentosFromDataArray = function(data){
        return data.map(function(procedimento){
            return {
                      pk: procedimento.pk,
                      nome: procedimento.fields.nome,
                      descricao :  procedimento.fields.descricao
                  }
        });
    }

    $scope.carregarProcedimentos = function() {

      procedimentoAPI.select_all_procedimento_by_medico($rootScope.user.googleToken)
      .done(function(data){
          $scope.$apply(function () {
            $scope.procedimentos = procedimentosFromDataArray(data);
            //$scope.atividades_planos =
          });
      }).fail(function(data){
          $rootScope.falha(data);
      });

    };

    $scope.carregarPlanos = function(){
      if(!$scope.planos.length){
        $scope.evento.carregandoPlanos = true;
        planoAPI.select_all_plano_by_medico($rootScope.user.googleToken)
        .done(function(data){
            $scope.evento.carregandoPlanos = false;
            $scope.$apply(function () {
              $scope.planos = data;
              console.log($scope.planos);
              $scope.atividades_planos = planosFromDataArray($scope.planos);
            });
        }).fail(function(data){
            $scope.evento.carregandoPlanos = false;
            $rootScope.falha(data);
        });
      }else{
          $scope.atividades_planos = planosFromDataArray($scope.planos);
      }
    }

    $scope.carregarHospitais = function(){
        if(!$scope.hospitais.length){
          $scope.evento.carregandoHospitais = true;
          localAPI.select_all_local_by_medico($rootScope.user.googleToken)
          .done(function(data){
              $scope.$apply(function () {
                $scope.evento.carregandoHospitais = false;
                $scope.hospitais = [];
                data.forEach(function(hospital){
                    $scope.hospitais.push({
                        pk: hospital.pk,
                        nome: hospital.fields.nome,
                        color: hospital.fields.cor,
                        text_color: $rootScope.getContrastedColor(hospital.fields.cor)
                    });
                });
              });
          }).fail(function(data){
              $scope.evento.carregandoHospitais = false;
              $rootScope.falha(data);
          });;
        }
    }

}

